import {useState} from 'react';
import { BrowserRouter, Switch, Route } from 'react-router-dom';
import Home from './pages/Home';

function App (){


  return (
    <Router>
      <Switch>
        <Route path="/home">
        <Home/>
        </Route>
      </Switch>
    </Router>
  )
}
export default App;
